INSERT INTO `u_news_data` VALUES ('12', '<b>项目介绍</b><br />\r\n<div class=\"maincontent clearfix\" id=\"MainContent\" microsoft=\"\" style=\"padding: 0px; margin: 0px; clear: both; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n<div style=\"padding: 0px; margin: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</div>\r\n<div style=\"padding: 0px; margin: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"font-family: 宋体; font-size: 9pt;\">水闸泵站监控系统工程主要是为了对水闸泵站群的联合运行进行有效监视和控制，保证闸门更加安全可靠运行。监控系统综合利用成熟的工业控制技术、传感器技术、数据传输技术以及计算机技术，建立先进的控制系统，提高工程的安全性、可靠性，充分发挥工程效益，促进水利工程管理的科学化、信息化、现代化。</span></div>\r\n<div style=\"padding: 0px; margin: 0px;\">&nbsp;</div>\r\n<div style=\"padding: 0px; margin: 0px;\">\r\n<div style=\"padding: 0px; margin: 0px;\"><strong>系统需求</strong>&nbsp;&nbsp;&nbsp;</div>\r\n<div style=\"padding: 0px; margin: 0px;\">\r\n<div style=\"padding: 0px; margin: 0px;\">&nbsp;</div>\r\n<div style=\"padding: 0px; margin: 0px;\"><span style=\"font-family: 宋体; font-size: 9pt;\">&nbsp;&nbsp;&nbsp; 水闸泵站监控系统一般设置在水闸泵站的监测站内，承担主要河道口门水闸泵站的水情信息、设备运行信息、河道闸站基本信息等相关信息的实时采集，并将采集来的数据信息存贮在各个闸站的实时监测业务库内。为保证监控系统的正常运行，需要一批稳定性强，性能高的工业平板电脑作为主控中心的控制设备。工业平板电脑必须具备多种应用端口，以满足主系统与子系统的通讯与联接，并完成数据的采集与交互。由于受工程预算的约束，在进行产品选型时，除了满足该设备技术要求的同时，还要考虑设备的采购成本</span><span style=\"font-family: 宋体; font-size: 9pt;\">。</span><span font-size:=\"\" style=\"font-family: \">&nbsp;</span></div>\r\n<div style=\"padding: 0px; margin: 0px;\">&nbsp;</div>\r\n<div style=\"padding: 0px; margin: 0px;\"><b>NODKA</b><b>解决方案</b></div>\r\n<div style=\"padding: 0px; margin: 0px;\">\r\n<div style=\"padding: 0px; margin: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 在与客户充分沟通后，诺达佳提出了解决方案：在每一个水闸泵站的监测点设一台17寸的诺达佳平板电脑作为控制PLC的上位机（工作站），现场的实时数据通过PLC完成采集，并通过平板电脑的串口将数据传输到主机。在群闸站汇结点设数据服务器，收集各站点的数据信息，并通过诺达佳平板电脑的网络接口保存所有的实时数据库中的数据信息及相关信息。在调度中心，诺达佳平板电脑作为地理信息监控系统主机，通过诺达佳平板电脑的显示画面，监控终端可以在调度室内监测各个水闸泵站现场的实时情况。</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div style=\"padding: 0px; margin: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</div>\r\n<div align=\"center\" style=\"padding: 0px; margin: 0px;\"><b>系统配置图</b></div>\r\n<div align=\"center\" style=\"padding: 0px; margin: 0px;\"><img alt=\"\" src=\"http://www.unihmi.com/uploadfile/2019/0613/20190613123721769.jpg\" style=\"padding: 0px; margin: 0px; border: 0px;\" /></div>\r\n<div align=\"center\" style=\"padding: 0px; margin: 0px;\">&nbsp;</div>\r\n<div align=\"center\" style=\"padding: 0px; margin: 0px;\">\r\n<div align=\"center\" style=\"padding: 0px; margin: 0px;\"><strong>系统工作站（图）</strong></div>\r\n<div align=\"center\" style=\"padding: 0px; margin: 0px;\"><img alt=\"\" src=\"http://www.unihmi.com/uploadfile/2019/0613/20190613123721773.jpg\" style=\"padding: 0px; margin: 0px; border: 0px;\" /></div>\r\n</div>\r\n<div align=\"center\" style=\"padding: 0px; margin: 0px;\">&nbsp;</div>\r\n<div align=\"center\" style=\"padding: 0px; margin: 0px;\">\r\n<div style=\"padding: 0px; margin: 0px;\">&nbsp;</div>\r\n<div align=\"left\" style=\"padding: 0px; margin: 0px;\"><strong>为什么选择NODKA？</strong></div>\r\n<div align=\"left\" style=\"padding: 0px; margin: 0px;\"><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>\r\n<div style=\"padding: 0px; margin: 0px;\">1、诺达佳平板电脑性价比高，与同等性能的同行产品相比，价格普遍低于20%以上，给客户节约了设备成本，创造了良好的经济效益。</div>\r\n<div style=\"padding: 0px; margin: 0px;\">2、诺达佳平板电脑的工业主板普遍采用INTEL生产的芯片组和超低功耗无风扇处理器，稳定性高，兼容性好，散热量低，在高温环境下运行不会死机。<br />\r\n3、诺达佳平板电脑配备丰富的工业控制常用接口，多串口、多USB口、双网口和2个32位PCI扩展插槽等接口，可充分应用于与其它设备的通讯与连接，具备良好的拓展性能。<br />\r\n4、诺达佳平板电脑采用铝镁合金材质，前面板PET贴膜达到NEMA IP65防护等级，在体现美观的同时具备很好的防护作用，确保在恶劣的工业现场不间断工作。</div>\r\n<div style=\"padding: 0px; margin: 0px;\">&nbsp;</div>\r\n</div>\r\n<div align=\"left\" style=\"padding: 0px; margin: 0px;\"><strong>应用产品介绍：</strong></div>\r\n<div align=\"left\" style=\"padding: 0px; margin: 0px;\">&nbsp;</div>\r\n<div align=\"left\" style=\"padding: 0px; margin: 0px;\">TPC6000-8170T</div>\r\n<div align=\"left\" style=\"padding: 0px; margin: 0px;\">&nbsp;</div>\r\n<div align=\"left\" style=\"padding: 0px; margin: 0px;\">关键字：工业环保&nbsp;&nbsp;可扩展工业平板电脑 工业平板电脑 诺达佳</div>\r\n</div>\r\n</div>\r\n<br />\r\n', '0', '', '0', '10000', '', '0', '27|27', '0', '1', '|0', '');
