INSERT INTO `u_page` VALUES ('2', '企业介绍', ';', '', '<p><strong>公司简介</strong><br />\r\n&nbsp;<br />\r\n北联显示2011年成立于中国长春，总部拥有1000多平方的办公场所。经过在工业计算机市场多年的坚持和发展，获得了良好的口碑，成为了行业领先的生产厂商。我们在北京、沈阳、西安、成都、上海、广州设立了6个销售和技术服务部门，为客户提供优质的本地化服务和技术支持。<br />\r\n北联显示专注于工业触摸显示屏、工业平板电脑和LED显示屏的研发和生产，与国内 3000多个客户达成合作，产品远销国外16个国家如西班牙、马来西亚以及新加坡等。产品主要应用于轨道交通、智能交通、机械制造、军工装备、环保及能源等领域。<br />\r\n公司2016年在北京投资建立了结构加工厂，加大了工业显示类产品的研发投入力度，引进先进的激光设备及高精度的折弯设备，拥有强大的研发、制造能力以及品质管控能力。公司通过了ISO9001质量管理体系认证，并申请了多项专利，提高企业的研发生产水平，快速的满足客户不同的需求，力争为客户提供最优质的产品和服务。<br />\r\n&nbsp;<br />\r\n&nbsp;</p>\r\n', '', '0');
INSERT INTO `u_page` VALUES ('3', '企业文化', ';', '', '<strong>愿景：</strong>成为世界一流的行业显示终端系统平台制造商。<br />\r\n<strong>使命：</strong>通过显示技术服务，提升行业人机交互基础平台，让视觉体验更绚丽。<br />\r\n<strong>价值观：</strong><br />\r\n持续投入研发，加强工程师队伍，满足客户不同的需求，为客户提供高品质的产品<br />\r\n鼓励创新，与合作伙伴共同成长<br />\r\n为顾客提供免费售后服务，如OS升级，漏洞修复，技术支持等。<br />\r\n追求卓越，保持团队精神，做最值得信赖的企业<br />\r\n&nbsp;<br />\r\n<strong>核心企业文化：</strong><br />\r\n<strong>1</strong><strong>、为客户创造价值</strong><br />\r\n关注并深刻理解客户需求，想客户之所想，做客户之所需，不断为客户提供最高品质的产品和服务，为客户创造更大的价值。<br />\r\n<strong>2</strong><strong>、为员工创造机会</strong><br />\r\n为员工提供良好的工作环境和激励机制。通过完善的培训体系和职业发展通道，使员工与企业共同成长，分享成功的果实。<br />\r\n<strong>3、永葆创业激情</strong>自北联创立以来，是用心血和汗水铺就的奋斗之路。一路走来，我们勇于担当、互信合作、百折不挠、永不放弃，与企业共同奋进。目前，正是企业高速发展的时期，我们要不忘初心，永葆创业激情，共同努力，力争成为优秀的行业显示终端系统平台第一品牌。<br />\r\n<strong>4</strong><strong>、做一个有情怀的企业，回报社会。</strong><br />\r\n在企业发展的同时，我们注重研发、生产、贮运等能源消耗问题,且不断推出环保型产品，为国家环保事业贡献一份力量。随着企业的不断壮大，我们也将积极投身于各项公益事业，用实际行动彰显一个企业的社会责任，做一个有温度、有情怀的企业将是我们不断坚持的目标。<br />\r\n&nbsp;<br />\r\n<br />\r\n', '', '0');
INSERT INTO `u_page` VALUES ('4', '产品领域', ';', '', '<strong>北联产品</strong><br />\r\n工业触摸显示屏<br />\r\n工业平板电脑<br />\r\nLED显示屏<br />\r\n&nbsp;<br />\r\n&nbsp;<br />\r\n<strong>产品应用领域</strong><br />\r\n<strong>轨道交通</strong><br />\r\nFAC售检票、FAST系统、闸机、地面PIS系统、车载PIS系统、站台信号指挥系统<br />\r\n<strong>智能交通</strong><br />\r\n驾考系统、电子警察、收费站、摄像头抓拍、路基检测、区间测速、车辆识别<br />\r\n&nbsp;<br />\r\n<strong>机械制造</strong><br />\r\n&nbsp;数控设备、纺织设备、印刷设备、激光雕刻<br />\r\n电力行业<br />\r\n风力发电、水利发电、核电、热力发电、电力成套设备、电流电压检测、电力并网数传<br />\r\n<strong>军工装备</strong><br />\r\n陆军车载、地面通讯、海军舰载、空军地面设备检测<br />\r\n<strong>环保及能源</strong><br />\r\n污水处理、河道检测、水质分析、气体分析、大气检测、油样分析<br />\r\n&nbsp;<br />\r\n<br />\r\n', '', '0');
INSERT INTO `u_page` VALUES ('5', '研发生产', ';', '', '<strong>产品研发</strong><br />\r\n北联显示拥有一批经验丰富、工作高效、富有创新能力的研发队伍，及时准确掌握产品最新动态和市场需求，针对最新技术研究和创新设计，建立了专业的系统研发、主板开发、结构设计、散热设计、产品测试及系统软件服务团队，严格执行公司制定的新产品研发流程管理，建立高低温、冲击振动、EMI/EMC等专业设施和设备，对产品进行全方位的可靠性测试，保障产品快速和成功的研发。<br />\r\nOEM/ODM<br />\r\n北联显示拥有丰富的工控行业经验、制造能力及研发资源，组建了独立体系的客制化服务团队，配备专业的项目工程师、电气和机构工程师、系统软件工程师和样机工程部，因此能够高效服务OEM/ODM客户前期选型、设计、样机制作、测试验证工作，产品定型后再导入到生产部门进行标准化批量生产，既能保证客户在前期设计和打样的快速反应需求，同时也能保证后续批量生产的品质管控。<br />\r\n<br />\r\n<br />\r\n<strong>生产制造</strong><br />\r\n北联显示遵循ISO9001质量管理体系建立完善的品质保障系统，产品设计品保阶段经严格的高低温测试、冲击振动测试、安全测试、EMI/EMC等可靠性测试和疲劳测试；生产品保阶段包括来料检查、生产过程巡检、动/静态烤机、功能/性能测试，确保北联制造的所有产品都是稳定的、可靠的，并有完善的系统组装工厂和钣金工厂保障我们能接受更多批量的订单生产能力。<br />\r\n<strong>技术服务</strong><br />\r\n强大的技术支持服务对于北联来说是至关重要的一环，所有的分支机构都配备专业的销售工程师和技术工程师，使客户获得最快捷的服务与最满意的解决方案；同时，客户还可利用北联丰富的FAQ数据库资料，透过我们网上的在线服务，得到实时更新的各种产品资料。<br />\r\n<br />\r\n', '', '0');
INSERT INTO `u_page` VALUES ('96', 'Introduction', ';', '', '<strong>Introduction</strong><br />\r\n&nbsp;<br />\r\nJilin Beilian Display Technology Co.,Ltd was founded in 2011 in Changchun, China with over 1000 square meters&rsquo; office and now is a&nbsp; leading industrial touch display manufacturer in the domestic market. We have 6 branch offices in Beijing, Shenyang, Xi&rsquo;an, Chengdu, Shanghai and&nbsp; Guangzhou all over the country.<br />\r\nWe mainly offer industrial touch monitor, industrial touch panel computer and LED display which were widely used by 3000 customers in China and 16 overseas countries such as Spain, Malaysia and Singapore and so on. And&nbsp; its application covers transportation, industrial automation, communication, power and energy, etc.<br />\r\nIn order to supply high reliable and durable products for customers, We have our own R&amp;D team and precision sheet machinery factory in Beijing.&nbsp; With strict quality control (wide temperature, vibration, shake and duration testing)and good service, we have high reputation among customers. As a ISO9001 qualified company, we welcome customers from all walks of life to contact us to establish business relationship.<br />\r\n&nbsp;<br />\r\n<br />\r\n', '', '0');
INSERT INTO `u_page` VALUES ('97', 'Culture', ';', '', '<strong>Our Mission</strong><br />\r\n&nbsp;<br />\r\nDedicated to display technology and service, improve the platform of Human Machine Interface and make better visual experience.<br />\r\n&nbsp;<br />\r\n<strong>Our Value</strong><br />\r\nContinuously cultivated R&amp;D and strengthen our engineer team in order to supply high-quality products which exactly meet our customers&rsquo; needs.<br />\r\nEncourage the innovation and grow up with our partner.<br />\r\nProvide free maintenance for customers including OS upgrade service, bug fixing and technical support etc.<br />\r\nPursue the excellence, keep team-work spirit and be a reliable partner.<br />\r\n&nbsp;<br />\r\n&nbsp;<br />\r\n<br />\r\n', '', '0');
INSERT INTO `u_page` VALUES ('98', 'Product Areas', ';', '', '<strong>Our Products</strong><br />\r\n&nbsp;<br />\r\nIndustrial Touch Monitor<br />\r\n&nbsp;Industrial Touch Panel Computer<br />\r\n&nbsp;LED Display<br />\r\n&nbsp;<br />\r\n<strong>Application Field</strong><br />\r\nEndless effort, Leading the industry<br />\r\nAfter 8 years&rsquo; development, Uni-HMI has become a leading company in the industry. &nbsp;Our products are widely applied in various areas, including subway, intelligent transportation, power and new energy, medical equipment ,environmental monitoring and mechanical manufacturing, etc.<br />\r\n&nbsp;<br />\r\n<br />\r\n', '', '0');
INSERT INTO `u_page` VALUES ('99', 'R&D/Produce', ';', '', '<strong>Product Research &amp; Development</strong><br />\r\nThere are a group of experienced, high-effective and high-innovative R &amp; D team in our company, which timely and accurately focus on &nbsp;latest formation on product development and market demand. We founded team for system development, board development, organization design, thermal design, product testing and software services, according &nbsp;to the latest technical research and innovation. Strictly following new product development process management, we have professional testing equipments for high temperature testing, shock and vibration, EMI / EMC in order to produce the reliable products and to ensure &nbsp;the product producing successfully and timely.<br />\r\n<strong>&nbsp;OEM/ODM</strong><br />\r\nWe have rich experiences, manufacturing capability and research resources in the field. At present, we &nbsp;have established an efficient customized service team for all OEM / ODM customers to create the most competitive products.<br />\r\n<strong>Manufacturing</strong><br />\r\nFollowing ISO9001 quality management system, we have established a complete quality assurance system for wide temperature testing, vibration testing, shock testing, security testing, EMI testing and fatigue testing. The quality control in the producing part includes IQC, IPQC,OQC, moving / static baking machine, function / performance tests to make sure all the products are stable and reliable.<br />\r\n<strong>Technical Services</strong><br />\r\nStrong technical support is a vital part &nbsp;for us. Each branch company is quipped with professional sales engineers and technical staff so that customers could get the most efficient service and the most satisfactory solution. At the same time, customers can take advantage of Uni-HMI&#39;s FAQ and our online services to obtain &nbsp;updated product materials.<br />\r\n&nbsp;<br />\r\n<br />\r\n', '', '0');
